import {
  FILE_UPLOAD_REQUEST,
  FILE_UPLOAD_SUCCESS,
  FILE_UPLOAD_FAIL,
  FILE_UPLOAD_RESET,
} from "../constants/fileConstant";
import axios from "axios";

//const API = "http://localhost:5000";

export const fileUpload = ({ fileUpload }) => async (dispatch) => {
  try {
    dispatch({ type: FILE_UPLOAD_REQUEST });
    const data = await axios.post({
      url: `/`,
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: { fileUpload },
    });
    dispatch({
      type: FILE_UPLOAD_SUCCESS,
      payload: data,
    });
  } catch (error) {
    dispatch({
      type: FILE_UPLOAD_FAIL,
      payload:
        error.response && error.response.data.msg
          ? error.respone.data.msg
          : error,
    });
  }
};

export const sayHi = () => async (dispatch) => {
  try {
    console.log("calling data");

    // const { data } = axios
    //   .get({ url: `${API}/say_hi` })
    //   .then((res) => res.data);
    const data = await axios(`http://localhost:5000/say_hi`)
      .then((response) => response.json())
      .then((data) => console.log(data));

    if (data) {
      console.log(data);
    }
  } catch (e) {
    console.log(e.message);
  }
};
